"title": "Train Birthday Shirt Tee Organic Blend Black Shirt Train Birthday Vintage train steam train second birthday custom",
"description": "This modern take on a train tee is perfect for every train loving guy.  Great for a train themed party or just a fun tee for a special boy.   Thin, black and white chevron used for lettering. Shirt pictured is eco heather black. Please see below for shirt color and sizing options.\r\n\r\nPlease note - depending on fabric he train direction and colors may differ. Each shirt is one of a kind and made to order.\r\n\r\n\r\nPLEASE READ ALL DETAILS REGARDING SHIRT SELECTION, SIZING AND ORDER PROCESSING CAREFULLY:\r\n\r\nThe easiest way to guarantee all of your order details are supplied at time of purchase is to simply copy and paste the following into &quot;Notes to Seller&quot; section in your cart and fill in all of the necessary information:\r\n\r\nShirt Size:\r\nBirthday:\r\nShirt Color:\r\nSpecial Instruction: (if needed)\r\n\r\n\r\nBIRTHDAYS\r\nAll shirts are available for birthday &quot;1/2&quot;  &quot;One&quot; &quot;Two&quot; &quot;Three&quot; &quot;Four&quot;, &quot;Five&quot;, &quot;Six&quot;. Additional birthdays and shirt sizes available as a custom request.\r\nThere is an ADDITIONAL fee for &quot;THREE&quot; (+ $4) and &quot;FOUR&quot; (+ $2) and &quot;FIVE&quot; (+$2) based on the fabric and time requirements.\r\nPlease use this link to conveniently add the additional letters for THREE to your order http://www.etsy.com/listing/83825187/additional-letters-for-your-lil-threadz\r\nPlease use this link to conveniently add the additional letters for FOUR to your order http://www.etsy.com/listing/83825278/additional-letters-for-your-lil-threadz.\r\nPlease use this link to conveniently add the additional letters for FIVE to your order\r\nhttp://www.etsy.com/listing/92286777/additional-letters-for-your-lil-threadz\r\n\r\nADDING A NAME TO YOUR SHIRT\r\nShirt can be customized with child&#39;s name on back for $2 per letter. \r\nYou can use this link to add a name to the shirt.  Please follow instructions for purchasing name add on or if you prefer, you can contact shop directly to create a custom listing to add a name to your shirt http://www.etsy.com/listing/93392290/add-a-name-to-your-lil-threadz-design\r\n\r\nSHIRT SIZES and COLORS\r\nThe SHORT SLEEVE shirts run true to size.  They are available in the following sizes: 3/6,  6/12, 12/18 months, 2T, 3T, 4T and 6T.\r\nHeathered Colors: black, grey, brown, red and blue\r\nWhite burnout and cherry burnout (only size not available in is 6T)\r\nSolid Green and Pink\r\nThe LONG SLEEVE shirts are a bit slim fitting so if a child is in between sizes I suggest sizing up.  All of the long sleeve shirts are solid color. They do not come in the heathered style.  LONG SLEEVE are an ADDITIONAL $2\r\n\r\n\r\nTURNAROUND TIME and SHIPPING\r\nMost items are completed and shipped within the processing times listed below (right above ship to quotes) Custom orders that require out of stock fabrics or shirts can take up to 10 days longer.\r\nI ship via USPS First Class.  This does not include insurance towards loss and damage. If you require that, please contact me BEFORE placing your order. I do use delivery confirmation on all orders.  I also offer USPS Priority shipping for $5.95.  Please contact shop before purchasing if you prefer to ship Priority.\r\n\r\nIf you would like more detailed information regarding shipping, exchanges etc please view my shop policies http://www.etsy.com/shop/lilthreadzclothing/policy\r\n\r\nEach lil threadz design is made by hand, from start to finish. Each appliqué uses fun and unique fabrics and is sewn on to top quality shirts by Alternative Apparel. The designs are hand-cut, applied to the shirts using a non-toxic adhesive and then sewn securely to the fabric. lil threadz is truly concerned about what types of dyes and chemicals linger on the clothes we place on our kids each day. Most of the shirts are super soft, eco-heather which is a uniquely imperfect blend of organic cotton, recycled polyester, and naturally occurring rayon.\r\n\r\n• eco-heather: 38% cotton (6.25% organic), 50% polyester (6.25% recycled), 12% naturally occurring rayon\r\n• yarn dyed, fabric\r\n\r\nCare Instructions: We suggest you wash this item inside out either by hand or in a normal wash cycle. Either dry on low or let the shirt air.\r\n\r\nlil threadz..... a lil bit of heart goes into each stitch.",
