"policy_welcome": "Thanks for checking out lil threadz.  I am a work at home mom who decided to explore my passion for designing children&#39;s clothes. lil threadz has blossomed into a hobby turned business which allows me to balance my family and work from home.  I can still make homemade meals, go to playdates and kiss boo-boos in between responding to customer emails,cutting fabrics and sewing special birthday shirts :)\r\n\r\n\r\nI hope you enjoy my shop :)",
"policy_payment": "Once an item has been purchased, please pay for your item through Paypal. If payment is not received within 48 hours and other arrangements have not been made, I will relist the item. If you pay with an echeck via paypal, your item will ship when the echeck clears.\r\n\r\nNo PayPal account? no worries, PayPal can still process your credit card info as payment, just choose PayPal as your payment method and follow the prompts for non-account holders.",
"policy_shipping": "Each shirt is made to order and 100% handmade by lil threadz.  We try to complete and ship each order within 7-10 business days (extra time during holidays) of confirmed payment to the address provided, sometimes sooner. \r\n\r\n**If you need a shirt asap, we do offer rush processing/shipping options. \r\nWe offer 2 different rush options. Both options guarantee the item will be completed and shipped out within 24-48 business hours (not counting weekend or holidays) from time of purchase.\r\n\r\nThe first one is an additional $10. The order would ship via Priority which is typically 2-3 but not guaranteed day delivery.  If you decide to go with this option you can simply add the shirt listing itself along with this link to your cart \r\nwww.etsy.com/listing/115241824/rush-service-for-your-lil-threadz-order?\r\n\r\nThe other option is sent via Express mail which is guaranteed 1-2 day delivery. This option is $25 and you can add this listing to your cart \r\nwww.etsy.com/listing/123030089/super-rush-service-for-your-lil-threadz?r...\r\n\r\nIf a package is shipped to the address provided and it is not the correct address, I am not responsible for the undeliverable package. If the undeliverable package is returned to me I will resend the shipment at customer&#39;s expense ($2.95).   \r\n\r\nCustom orders where fabric needs to be stocked typically take a bit longer to complete and ship, usually up to 5 business days and in rare instances as much as 10.  If I need more time to create your items I will contact you. \r\n\r\n♥DOMESTIC (US) SHIPPING:\r\nI ship via USPS First Class.  This does not include insurance towards loss and damage. If you require insurance, please contact me BEFORE placing your order. I do use delivery confirmation on all orders.  I also offer USPS Priority shipping for $5.95.  Please contact shop if you prefer to ship Priority.\r\n*I always obtain Delivery Confirmation for each shipment, I cannot, therefore, be held responsible for items lost in the mail.  I also provide each customer with the delivery confirmation number to allow the item to be tracked.  If you do not receive your package within one week of receiving your shipping confirmation please let me know and I will do my best to assist in obtaining information on its whereabouts.  \r\n*If I commit to shipping an item by a certain date, I most certainly will.  However, once I ship an item it is out of my hands.  I cannot be held responsible for items that do not arrive on a specified date when shipping via USPS First Class mail.  If you would like to guarantee shipping by a specific date please contact me to set up a different shipping option.\r\n\r\n♥INTERNATIONAL CUSTOMERS: \r\nAll international packages are sent via First Class Mail International airmail to the address provided in the order details.  There is no way to track delivery and it does not include insurance for losses/damages during shipment. We cannot provide a delivery date or guarantee receipt by a specific date for international packages when shipping via first class mail. If you would like a more secure shipping option like Fedex please contact shop for rates but they are considerably more.  If there are any Customs/Duties fees, they are the responsibility of the buyer.  We are not responsible for tariffs, taxes etc assessed by the country the item is being shipped to. \r\n\r\nI will combine items in order to conserve packaging materials (unless you specify otherwise).  All receipts are viewable and printable on Etsy so I do not include them in the package.  \r\n",
"policy_refunds": "I want you and the special children in your life to love your lil threadz design!  All of our items are made to order and created by hand, for you. If you do order something and you have any concerns please contact me before leaving feedback so we can remedy the situation as customer satisfaction is my number one priority! \r\n\r\n\r\nIf there is an issue with your order please contact me within 5 days of item&#39;s receipt. \r\nIf we decide that the order will be returned or exchanged it must be sent back within 7 business days of receipt and I also ask that it be returned with delivery confirmation so there is no question regarding it&#39;s whereabouts in transit. If an item is being returned/exchanged due to a lil threadz error we will provide a prepaid return label for you to send back the shirt.  All return/exchange items must be unworn and unwashed. No exceptions.\r\n\r\nReturns/Exchanges are not accepted on custom orders. This includes designs not pictured in the shop, name additions, custom fabric designs, as well as designs where birthday listed and shirt size are larger or smaller than corresponding age (example 3rd birthday shirt on size 6 tee).  \r\n\r\nReturns/Exchanges are not accepted on &quot;READY TO SHIP/SALE&quot; items. These items are final sale and purchased as is.\r\n",
"policy_additional": "♥Custom Orders? Love em!  I love creating new designs for custom orders and welcome special requests for fabrics/designs you don&#39;t see in my shop.  Since custom orders typically require the purchase of fabric  there is normally a nominal fee.  Custom orders tend to take a bit longer to complete and ship, usually up to 5 business days and in rare instances as much as 10. Please contact me to discuss your request and set up a custom listing.\r\n♥For Buyers: When you receive your order, I encourage you to leave feedback on Etsy. Your feedback tells me that you have received your items, are happy with the merchandise, and consider our transaction complete. \r\n♥Wholesale inquiries welcome\r\n",
