"title": "Duncan Creek Crafts",
"announcement": " We have stylish handmade scarves, hats, newsboy caps, sun hats, and sun visors at a reasonable price. All of our items are handmade right here in Kentucky(in this house actually). The items in the shop are ready to be shipped, so we can have your item processed and in the mail within 3 days.  If you decide to purchase an item, and need a rush on the shipping, please contact us prior to ordering. We normally ship USPS First Class with delivery confirmation which does not guarantee the arrival of your order in a specific amount of time(generally takes 3-5 days continental US). We will be happy to work with you on items needed in a specific amount of time, but shipping costs will be higher. In an effort to keep our prices low, we are unable to take custom orders (unless you have had a custom order from us in the past). Please feel free to contact us with any questions. Thank you for visiting our store!  ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for shopping with us! Your order should ship within 3 days (not including shipping time).",
"digital_sale_message": null,
