"login_name": "DuncanCreekCrafts",
"accepts_custom_requests": false,
"policy_welcome": "Thank you for visiting Duncan Creek Crafts!\r\n\r\nAll hats are hand-crafted here at home. A variety of material types are used in the making of these hats so some may not be lined. We have sold these at a local store where they seem to appeal to both male and female, young and the young at heart!\r\n\r\nIf a hat is posted, it is up for sale and ready to be mailed.  It will be placed in the mail within 3 business days (not including actual shipping time). In order to keep our prices low, we are no longer able to take custom orders (unless you have had a custom order from us in the past).\r\n\r\nPlease send us feedback on our shop if you have any suggestions or questions. Also, we want you to be satisfied, so please let us know if there are any problems with your order. All orders should ship within 3 business days. We normally use USPS first class for shipping which usually takes 3-5 business days (no guarantee, though). We would be happy to work with you on faster shipping if needed (at an additional shipping cost)-please notify us prior to purchase.\r\n\r\nWe ship the hats folded in a lightweight poly mailer(most economical way to ship) so  the hat may need a short run in the dryer on low setting with a damp cloth to remove any wrinkles. If you wish to order more than 3 baby hats or more than 2 adult hats, please let us know before purchasing them-we will ship your hats in the most economical way.\r\n\r\nRefunds and Exchanges: We really appreciate your business, and want you to be happy with your hat. If there is a problem with your hat, please let us know as soon as possible. For customers within the continental United States- Refunds (minus shipping charges) will be gladly given after the hat has been returned to us within 2 weeks of the date that it was delivered to you. For customers outside the continental United States-Refunds (minus shipping charges) will be gladly given after the hat has been returned to us within 4 weeks of the date that it was shipped from us.",
"policy_payment": "We accept payment through direct checkout which includes major credit cards or through Paypal.\r\n\r\nImmediate payment is expected on all orders. If payment is not received within 48 hours, we will cancel the sale. \r\n\r\nIf you need help checking out, Etsy has a help link which is\r\nhttp://www.etsy.com/help_guide_checkout.php\r\n\r\nIf you are paying with a credit card through Paypal, click Pay Now. You will be taken to Paypal to complete the purchase. You do not need a Paypal account to pay with Paypal-you can pay with a credit card through Paypal. After payment, you will be redirected back to Etsy.\r\n\r\nYou must go to Paypal for each seller. Etsy will track how many payments are remaining, and you will know payment is complete when a green check mark appears under your items.\r\n\r\nOnce again, please let us know if you have any problems.",
"policy_shipping": "We ship USPS First Class with a delivery confirmation on orders within the continental US (generally takes 3-5 business days). All orders will be processed within 3 days(minus shipping time).\r\n\r\nDelivery confirmation is not available for orders shipped outside of USPS system.\r\n\r\nWe are happy to work with you on faster shipping (at increased shipping charge) if notified prior to purchase.\r\n\r\n Please see &quot;Welcome Message&quot;. \r\n",
