"description": "Looking to add a tulle train to your custom flower girl, bridal, or special occasion dress?! This listing is for a tulle train ONLY as shown attached to the dress in our photos. You may specify the tulle color and train length from our drop down menu upon purchase. If you don&#39;t see the color you are looking for just email me and I will be happy to add it to the options. \r\n\r\nTrain is made using a satin ribbon design. They measure in width approximately 11&quot; across and length is custom made to your specifications. Each strand of tulle is hand tied tightly for the fullness and poof shown in our model photos. Train is quadruple layered for fullness. Each end of the train features satin ribbons that will weave through the stretch crochet found on tutu dresses and ties a bow on each side. This allows the train to be easily removed for dancing and twirling after the wedding photos. They are also gorgeous in birthday photography. \r\n\r\n\r\n\r\n* A very special thank you to our model Chloe and Amber Urey Photography for such GORGEOUS photos of our gown~\r\n\r\nwww.Facebook.com/LindisCustomDesigns\r\n\r\n~ Lindi",
