"sale_message": "Thank you so much for your order. If you ordered individual patterns they are available for immediate download (once your payment is received). If you ordered a pattern package I will send them out via email in pdf files within 2 days, usually much sooner. If you do not receive it within that time frame please check your spam and/or trash folder.\r\n\r\nI am on vacation with my family from August 29 - September 1, 2014. I will reply to all messages as soon as I return. Thank you for your understanding.\r\n\r\nIf you have any questions about your pattern please feel free to contact me at MySweetPotato3@gmail.com. \r\n\r\nFollow me on facebook to see new releases, promotions, chances to test patterns and other crochet fun: www.facebook.com/SweetPotato3Patterns. Thank you again for your order, \r\n\r\nChristine",
"digital_sale_message": "Thank you so much for your order. I hope you enjoy crocheting your newest pattern. If you have any questions contact me at MySweetPotato3@gmail.com.\r\n\r\nI am on vacation with my family from August 29 - September 1, 2014. I will reply to all messages as soon as I return. Thank you for your understanding.\r\n\r\nFollow me on facebook to see new releases, promotions, chances to test patterns and other crochet fun: www.facebook.com/SweetPotato3Patterns. Thank you again for your order, \r\n\r\nChristine",
"last_updated_tsz": 1412696405,
"listing_active_count": 133,
"login_name": "SweetPotato3Patterns",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to Sweet Potato 3 Patterns (sister store of My Sweet Potato 3). I am a stay at home mom of 3 children who are my inspiration and joy of my life along with my husband. As a young girl my Great Grandmother taught me the art of crocheting. I have been developing my skills since and love creating my own designs which I hope to share with you. I hope you enjoy the patterns I have created, please check back as I will keep adding new items. Please feel free to contact me if you don&#39;t see what you were hoping for, I have a stack of patterns just waiting to be published. To see new releases, promotions and opportunites to test new patterns follow me on facebook at: www.facebook.com/SwetPotato3Patterns.\r\n\r\nIf you are interested in a completed item you can either send me a convo or check my other shop: MySweetPotato3.etsy.com",
"policy_payment": "I accept payment through paypal and most major credit cards. \r\n\r\nSales Tax will be applied to Idaho Residents (sorry, but I have to pay them too).",
"policy_shipping": "Patterns are available for immediate download upon purchase UNLESS you purchased a bulk pricing package. The bulk packages will be emailed in PDF files within 2 business days. I do my best to get them to you sooner. If it has been 2 business days and you haven&#39;t received your pattern by email please check your spam or trash folders before contacting me. Thank you.",
"policy_refunds": "Due to the nature of patterns all sales are final-no refunds will be issued.",
"policy_additional": "Sizing information for hat patterns from Sweet Potato 3 Patterns:\r\n\r\nSizes are approximation to an age, all children are unique in size so please measure for accuracy. I size my hats according to the CDC Head Circumference for Age Charts and track/size according the 50th percentile. Hats should fit barely snug (ideal fit will be about 1-2 inches smaller than the head measurement).\r\n\r\nNewborn (12 ¼ ” around & 5” high - fits up to 14” circumference)\r\n3 to 6 Months (14” around & 5 ½ “ high - fits up to 15&quot; or 16&quot; circumference)\r\n6 to 12 Months (16&quot; around & 6” high - fits up to 18&quot; circumference)\r\n12 to 24 Months (17&quot; around & 6 ½ “ high - fits up to 19&quot; circumference)\r\nChild (18” around & 7 ½ “ high - fits up to 20&quot; circumference)\r\n\r\nCare for all crochet items:\r\nI recommend hand washing and laying flat to dry. Machine washing and drying will cause the item to shrink\r\n",
"policy_seller_info": "Shop for completed items: MySweetPotato3.etsy.com\r\nfacebook: facebook.com/SweetPotato3Patterns\r\nemail: MySweetPotato3@gmail.com\r\n",
"policy_updated_tsz": 1362971355,
