"title": "Handmade by Caitlin",
"announcement": "Handmade by Caitlin is your outlet for unique baby gifts. From booties and hats to plushies and blankets, this is your one stop shop! All items are handmade with longevity and washability in mind.\r\n\r\nYou may have know me previously as Caiti Scarlet Designs. While the name has changed, I will still be offering handmade jewelry. I also plan to expand my selection to offer more knitting related items and skin care items.\r\n\r\nI welcome custom orders, so please feel free to contact me for any special request. Please look around, or visit caitinc.blogspot.com for more examples of my work.\r\n\r\nIf you are looking for a unique custom portrait that is hand drawn or painted, contact my sister: cassieinc.etsy.com She is a talented artist and can reproduce any picture you want in pencil, ink, or paint!",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hello loyal fans and customers! I am moving at the start of September and going on vacation at the end of September for 2 weeks. So to avoid crazy time crunches, my shop will be on vacation for the whole month. I look forward to getting back in the swing of things and making cute items for you in October!\r\n\r\nPlease feel free to contact me in regards to custom orders, as I will still be checking my messages, and we can discuss details. Any orders already placed that were due to ship during this time will still be sent out on time!",
"sale_message": "Thank you for purchasing from Handmade by Caitlin! Due to an increase in orders, there is a 3-5 business day lead time before I will be able to craft your item. Please contact me if you have any questions or concerns. Enjoy your special gift :)",
"digital_sale_message": null,
"last_updated_tsz": 1410632261,
"listing_active_count": 33,
"login_name": "caitinc",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to Handmade by Caitlin!\r\n\r\n",
"policy_payment": "At the moment I only accept paypal as an official form of payment. \r\n\r\nIn the event you do not have a paypal account, you can contact me to arrange alternate payment. However, until an arrangement has been made the item you are interested in will remain available in the store. I can try to recreate these in the event the item is sold, but additional time may be needed. \r\n\r\nAfter arrangements have been made, items will not be shipped until payment has been received. This will have a large impact on the shipping time, so please be aware.",
"policy_shipping": "All items are shipped only after payment has been received. This is both for your benefit, to ensure the shipping and insurance costs are covered, as well as mine.\r\n\r\nAt the moment I only have US shipping listed with standard prices, but I am working on putting together international prices as well. All domestic packages are shipped using USPS First Class or Priority Mail, and international packages are shipped using USPS First Class Mail. Insurance and tracking information is provided for every shipment. Multiple items may be shipped in one package to cut down costs.\r\n\r\nFor international buyers: I apologize for the current lack of pricing information, but please contact me for a quote and I can update your listing or invoice :)\r\n\r\nFor some general information on what international shipping may include, you can check this post on my blog: http://caitinc.blogspot.com/2013/03/international-shipping-for-handmade-by.html",
"policy_refunds": "My aim is to make sure you know what you are purchasing before hand, including colors and sizes. Generally, I will not give refunds or exchanges unless it is due to an issue of quality. In the event you receive something of poor quality, I will exchange/replace it for free. Refunds are generally not given as my time and materials have already been forfeited. \r\n\r\nAs always please feel free to contact me regarding an issue with your purchase and I will work with you to come to a solution that we are both happy with. Each issue will be handled individually.\r\n\r\nAll items are shipped with insurance, to cover loss. If an item has not been received, please contact me and I will fix things as quickly as possible. Such situations will be handled in a way that best works for both of us , so actions will vary on an individual basis.",
"policy_additional": "I am more than happy to create custom items. I thoroughly enjoy the process of creating something unique. Please contact me so that we can work out the details, and I will make a custom listing for you. Do keep in mind custom items will take additional time in order for me to obtain the materials and craft it for you (I would suggest planning on 1 week turn around for small-medium orders, but if you need a rush order I will try to accommodate you).\r\n\r\nFeel free to contact me with any additional questions I may not have answered.",
"policy_seller_info": null,
"policy_updated_tsz": 1369855269,
"vacation_autoreply": "Thank-you for your inquiry. I am in the process of moving and have a vacation planned on the heel of that, but will be checking my messages regularly, so you can expect a reply within 24 hours.\r\n\r\nIf you would like to discuss a custom item, please send me details about what you are looking for and I will get back to you with a time frame and expected price as soon as possible. Ready-made items have been packed up though, so will not be available until I get back from vacation.",
