"description": "William Cahill / 1950s Wedding Dress / Vintage Wedding / Mad Men / Train Circle / Wedding Gown / Traditional / Long Sleeve / White\r\n\r\n\r\n\r\nHere Comes THE Bride.\r\n\r\n\r\nI&#39;m betting that little girls who dressed their dolls up and had weddings, dreamed of a wedding dress like this vintage 1950s beauty from legendary bridal designer William Cahill. This mid century gown is so dreamy and divine...from its floral appliques to its nipped in waist to its real sleeve buttons that actually button to its circle train (that circle train just had me think of the bride in the photographers studio and getting the circle just perfect for the portrait). My photos do not begin to do the dress justice. It is a small size and in Very Good Condition (please see below for full condition). This dress is perfect for vintage lovers, brides who want a traditional dress, a girl who wants to look like a lovely, romantic vision and those who want a bridal couture gown without the hefty price tag. Here&#39;s your gown. \r\n\r\nIf you were going to the Chapel in the 1940s through the 1960s, and you wanted the best in a bridal wear, chances are high that a wedding gown from William Cahill was your choice. The designer was also a favorite of &#39;Wedding Wear&#39; magazine for three decades. Cahill gowns are highly sought after by brides-to-be and collectors alike, because of Cahill&#39;s superior construction, and beautiful fabric. William Cahill wedding gowns are truly pieces of art. \r\n\r\n\r\n\r\nHistory/Backstory: A Vintage Virginia Find.\r\n\r\nCondition: Very Good to Excellent. (I&#39;m a very harsh grader.) The dress is fully lined. This dress is MAGNIFICENT. It is constructed with the finest materials and with the best craftsmanship. There are a few flaws, but really to be expected, since the dress is 45+ years. The dress could walk down the aisle tomorrow  without even going to a specialist cleaner. (I would recommend a specialist cleaning though.) No yellowing (only slightly under the underarms, worse under the left arm.) Please see Photo 5. The third pic on the top shows a mark that is on the right front of the dress just below where the lace bodice hits the skirt. Small brown dot (1/4&quot;) on right sleeve. The flaws in no way detract from the overall appearance or utter FABULOUSNESS of the dress. I have taken this into account when pricing the dress. Please convo if you would like additional photos. \r\n\r\n\r\nLabel: William Cahill California\r\n\r\n\r\nMaterial: No material label. The bodice has floral lace appliques. The skirt is a taffeta like material.\r\n\r\n\r\nCare: Caution Dry Clean Only. Dangerously Flammable if Washed. \r\n\r\nSize: No Size. It is small. Please refer to the measurements listed and compare to your own body measurements as well as to the measurements of your own well-fitting dress.)\r\n\r\nMeasurements:\r\n\r\n(All measurements are taken with the garment lying flat and all buttons buttoned, zippers zipped....you get the idea. Measurements are doubled where appropriate, i.e. for bust, waist, hips. Measurements are in inches. I still haven&#39;t mastered the metric system.) Please note that clothes are usually pinned for the best fit on the skinny minny mannequin and dress form.\r\n\r\nLength (from shoulder/neckline to hem): 59&quot; (front) 84&quot; (back, the train) \r\n\r\nTrain Width (Across): 80&quot;\r\n\r\nBust (armpit to armpit): 32&quot;\r\n\r\nWaist: 26&quot;\r\n\r\nHips: 36&quot; (free) \r\n\r\nSleeve (from shoulder to cuff): 26&#39;\r\n\r\nSleeve Width: 6&quot; (widest, top) 4&quot; (cuff)\r\n\r\n\r\nColors: Wedding White.\r\n\r\n\r\nPackaging: The dress will be carefully packaged and shipped via USPS Priority Mail. \r\n\r\n\r\nPlease convo if you prefer a different shipment method, like Parcel Post.\r\n\r\nI love to combine shipping and I always refund postage overages.\r\n\r\n\r\nSmoke free home.\r\n\r\n\r\nThank you so much for taking the time to look.\r\n\r\nHere&#39;s another Wonderful Wedding Dress:\r\n\r\nhttps://www.etsy.com/listing/120208089/gunne-sax-dress-wedding-dress-1980s\r\n\r\n&\r\n\r\nHere are more Divine Dresses:\r\n\r\nhttp://www.etsy.com/shop/TheThriftingMagpie?section_id=11036413\r\n\r\n\r\nIf you have any questions or would like more photos, please do not hesitate to convo me.\r\n\r\nTo learn more about me:\r\n\r\nhttp://www.etsy.com/people/TheThriftingMagpie?ref=si_pr#\r\n\r\nTo learn about The Thrifting Magpie&#39;s policies, including layaway:\r\n\r\nhttps://www.etsy.com/your/shops/TheThriftingMagpie/policies\r\n\r\n♥Tracey",
