"shop_name": "TheThriftingMagpie",
"user_id": 11336791,
"creation_tsz": 1307613040,
"title": "Designer & Vintage Finds Waiting To Be Found",
"announcement": "Designer finds and vintage pieces—Accessories, Bags, Clothing, Jewelry, Shoes—along with unique decorative items can all be found at The Thrifting Magpie. You never know what you will find.  \r\n\r\nI am so excited to be a part of the Etsy Community. As a Vintage Lover team member I promise to uphold to the best of my ability the Vintage Integrity pledge: &quot;All vintage goods in my shops are at least 20 years old.&quot;  Thanks for stopping by The Thrifting Magpie! \r\n\r\nYou can also find me at:\r\n\r\nwww.thethriftingmagpie.com\r\nwww.facebook.com/thethriftingmagpie\r\nwww.pinterest.com/thriftingmagpie\r\nwww.twitter.com/thriftingmagpie\r\n\r\n♥Tracey",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you so much for your purchase. It is very much appreciated. Your package will be sent in a timely manner and I will email all relevant information. If you have any questions or concerns, before or after receiving your package, please do not hesitate to contact me.\r\n\r\nAgain, thank you for shopping The Thrifiting Magpie. You are a thrifty shopper.\r\n\r\n♥Tracey",
"digital_sale_message": null,
"last_updated_tsz": 1408617819,
"listing_active_count": 101,
"login_name": "TheThriftingMagpie",
"accepts_custom_requests": false,
"policy_welcome": "Hiya and welcome to The Thrifting Magpie. I love finding &#39;finds&#39;. I never know what  I will find next, so please check back often. If there is something &#39;special&#39; you want, please convo me and I will do my best to find it. I want to bring beautiful things into my customers&#39; lives that will provide them with lots of happiness and wonderful memories.\r\n\r\nI am a member of the Vintage Lovers Team and I uphold the VINTAGE INTEGRITY PLEDGE to the best of my ability and knowledge: &quot;Vintage goods in my shop are at least twenty years old.&quot; \r\n\r\n\r\n♥Tracey",
"policy_payment": "The Thrifting Magpie gladly accepts credit cards, debit cards and Etsy gift cards via Etsy&#39;s Direct Checkout. The Thrifting Magpie also accepts payment via PayPal. \r\nAs soon as payment clears, your item(s) will be posted. Payment within 7 days of purchase. If for some reason, you need more time, please convo me so we can work something out. For layaway terms, please see additional information.",
"policy_shipping": "ALL SHIPPING, BOTH DOMESTIC & INTERNATIONAL:\r\n\r\nItems are shipped 1-2 days from purchase. I ship USPS Priority Mail which includes delivery confirmation for domestic shipments and Track & Confirm for international shipments.\r\n\r\nWith high ticket items, shipping prices will be reflective of included insurance.\r\n\r\n I ship to the confirmed address listed on your PayPal account.\r\n\r\nItems will be well packaged...bubble wrapped when needed, etc, and items are wrapped in acid-free tissue paper.\r\n\r\nI am happy to combine shipping when purchasing multiple items. Any overpayments on shipping will be refunded via PayPal.\r\n\r\nDOMESTIC SHIPPING:\r\n\r\nIf you prefer a different shipping method (FedEx, UPS, etc.) rather than USPS Priority Mail,  please convo me before making your purchase so I can see what the shipping price will be with the alternate shipper and make any necessary adjustments to the quoted shipping price.\r\n\r\nINTERNATIONAL SHIPPING:\r\n\r\nI ship most packages via USPS Priority Mail. I find it is one of the safest and most reliable ways. Packages can be tracked. It can be expensive. I am always happy to ship First Class International if the item(s) are under the weight and size restrictions: \r\n4 pounds (1.81 kilos ) and a combined height, length and width of 36 inches (91.44 centimeters).\r\n\r\nFor some listings I have quoted the shipping for First Class International. Please convo if you would prefer Priority Mail or another shipping service.\r\n\r\n Any custom charges/tariffs are the sole responsibility of the buyer. Also, please check with your country&#39;s import laws to make sure that your purchase is not on the banned list. For example, some countries do not allow used leather products. That means no leather bags, shoes, belts, etc. from The Thrifting Magpie.  \r\n\r\nAnd the final note, I cannot be held responsible if the package is held in customs for a prolonged period of time. Please allow 4 to 6 weeks for packages to be processed.\r\n\r\n",
"policy_refunds": "I want you to love your purchase and love shopping with The Thrifting Magpie. If for any reason, you find the love connection isn&#39;t there after you receive your item, you have 7 days from the time you received your package to return it. Please convo me and let me know that you will be sending the item back. The sooner, the better and 5 gold stars if it&#39;s within 48 hours from when you received your package. The item(s) must be in the exact condition as how it was shipped to you, i.e. no pulled seams on clothing articles, no missing stones on jewelry, etc. You get the idea. Your monies will be refunded via PayPal. Shipping costs will not be refunded. Return shipping is the responsibility of the buyer. ",
"policy_additional": "I want to make shopping on The Thrifting Magpie as enjoyable and easy as possible. \r\n\r\nI am happy to offer a layaway option for purchases totaling $100 or more, with one or more items. A minimum of 20% down with one month to pay from the date of the initial payment.  For purchases of $500 and above, a minimum of 20% down and two months to pay from the date of initial payment. If more time is needed, please convo me so we can discuss. I want to provide terms that work for my customers. Deposits are non-refundable. Payment-in-full must be received by the final date, unless prior agreed upon terms have been arranged. In the case that payment-in-full is not received by the final payment date, buyer forfeits the layaway item and the initial 20% deposit. Any monies paid surpassing the initial 20% will be refunded back to the buyer via PayPal.\r\n\r\nI sell vintage, designer, collectible and decorative items. Vintage by its nature means that the item has had a former life with someone else. It has been pre-owned, and pre-loved, to varying degrees. Vintage means not perfect. \r\n\r\n I am well versed and knowledgeable about many areas of vintage, designer, collectible and decorative items. However, I am not an expert on everything. I learn something new everyday. I believe in selling only authentic items. I hate wanna-be&#39;s. No fakes here. \r\n\r\nAll of this said, I am human and humans make mistakes. In the case that I have made a mistake, and for example, something I believed and researched to be authentic, i.e. a genuine designer vintage bag, is proven not to be authentic, I will happily refund all monies, including postage. \r\n\r\nPlease buy with confidence. I have been dealing with vintage/designer/collectibles  for over a decade, and really, the passion has been there my whole life. I buy from trusted sellers. If I have any questions of authenticity, I go to a trusted authenticator or straight to the original source, i.e. Louis Vuitton if it&#39;s a vintage Speedy.",
"policy_seller_info": null,
"policy_updated_tsz": 1389834630,
"vacation_autoreply": "So sorry to be out of touch. I&#39;ll be away for a bit (a long bit.)\r\n\r\nI&#39;ll be in touch as soon as I can.\r\n\r\n♥Tracey",
