"policy_welcome": "I love using wood as a canvas! Whistles are just the beginning. I can also create personalized boards with any quote, phrase, or verse of your choosing. Convo me to get started!",
"policy_payment": "Most orders will be shipped 3-5 business days after receiving payment.\r\n\r\nAll cancelations need to be made within the first 12 hours of ordering or before the customization process has begun. Please convo me immediately if you desire to cancel your order to see if customization has already started.",
"policy_shipping": "Orders shipped outside of the US may be charged a customs fee or taxes which will be in addition to my shipping charges. Please plan accordingly.\r\n\r\nIf you desire a faster shipping method just let me know and I will create a special post including the extra shipping fees for faster shipping.  ***PLEASE NOTE:  the only guaranteed delivery method is via NDA (Next Day Air).  I am not responsible for orders that are delivered late due to Post Office Delivery delays.***\r\n\r\nAll orders are sent USPS first-class mail usually arriving to destinations in the US within 3-5 business days. If shipping to out of US address, shipping will be done through USPS in whichever shipping method works for the delivery address. If you would like your order to be sent via a different carrier or with a different speed please contact me.\r\n\r\nIf your order is shipped to an area where customs fees are charged, these are fees that must be paid by the customer as an additional charge.\r\n\r\nI cannot guarantee timeframes for shipping.  Once an order is shipped, all shipping responsibilities are USPS responsibilities and All Aboard Whistle will not be held responsible for delays in shipping because of delays or errors made by USPS.\r\n\r\nPlease double check all information given for shipping as I will ship to the address given to me.  If you give an incorrect address for shipping at time of purchase, please contact me immediately for assistance.  If, however, the order ships to an incorrect address due to error made by the purchasing party, All Aboard Whistle will not be held responsible for wrongly delivered items. Again, please double check all information, both shipping and personalization, prior to placing an order.  Thank You!",
"policy_refunds": "If you are unhappy with your order please contact me within 30 days of purchase for a refund (minus shipping costs).  If requesting a refund after the 30 day window, returns will not be accepted.\r\n\r\nAll Aboard Whistle will refund for unpersonalized items (such as hats and/or bandanas) or orders with incorrect personalization due to an error made us.  If orders are created with correct personalization (personalization as was given in notes to seller), no refund will be given except on unpersonalized items.  It is imperative that all personalization information is 100% accurate as I will not offer refunds for incorrect personalization that was given to me incorrectly. \r\n\r\n",
"policy_additional": "I would love to do a customized order for you or your party; either a larger number of whistles or a wooden quote board. These orders do take some additional time concerning which we can discuss. Please convo me to get your order started!!!",
"policy_seller_info": "Stacy Hoban\r\nAllaboardwhistle@gmail.com\r\n\r\nIf you require additional information please contact me.  Thank you.",
