"title": "Personalized party printables ",
"announcement": "A Party Studio offers custom invites, labels, water bottle wrappers, chocolate kiss stickers and other personalized decorations for your party needs! Baby showers, Baptisms/Christenings and children&#39;s birthday parties is our specialty!  Please like us on Facebook: www.facebook.com/apartystudio to stay up to date with our party news!\r\n\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "I am currently on vacation and do not have computer access. If you need to reach me, you can e-mail: apartystudio@gmail.com however please note that I will limited- if any- internet access whilst on vacation\r\nStay in touch via Facebook: www.facebook.com/apartystudio or Twitter @apartystudio\r\n\r\nMy store will reopen on June 28th. ",
"sale_message": "Current turn around time is one to three business days from time of payment however, I will do my best to get your files to you as soon as possible. \r\n\r\nI love posting your party photos on my blog and Facebook page!!! If you&#39;d like to share your special day, please e-mail me some photos after your party. apartystudio@gmail.com\r\n\r\nThank you for your order! \r\nTali\r\n\r\n-- \r\n\r\n\r\nhttp://www.apartystudio.etsy.com\r\nhttp://www.facebook.com/apartystudio\r\nhttp://pinterest.com/apartystudio/\r\nhttps://twitter.com/apartystudio \r\n\r\n\r\n",
"digital_sale_message": "Generic Info on Printing\r\n\r\nhttp://apartystudio.wordpress.com/2011/08/24/party-decoration-costs-and-printing-issues/\r\n\r\nI do highly recommend getting everything printed on a laserjet printer because the quality is exceptional. If you don’t have a laserjet printer at home then no worries you can head to your local print/copy center. My local Office Depot only charges 69 cents a sheet for color prints on card stock (59 cents if I take in my own cardstock) before tax. If you go that route, then they have computers in their print/copy center so you can pull up all the files I e-mail you there (just log onto your yahoo/gmail/hotmail/etc account and download on their computer).  That way, you don&#39;t have to deal with saving everything on to a CD or thumb drive. Let me know if you have any questions about printing. \r\n\r\nThat being said, you can certainly print these on your home printer even if it is an inkjet.\r\n\r\nMake sure if you use a print/copy center (or print at home) that you specify that they do not alter the size and that the quality is set to high. I recently used UPS and when I saw the print outs, I thought the colors were not as vibrant as they should have been and sure enough, when I got home and compared to what I&#39;d printed out from Office Depot (in the same colors/party collection), the colors were not as strong. I didn&#39;t even think to ask them about the quality. I just assumed it&#39;d be on high so remember to mention that whenever you get prints done at a copy/print center. \r\n\r\nPlease contact me via e-mail if you have any questions at all. apartystudio@gmail.com\r\n\r\nThank you,\r\nTali \r\n\r\n-- \r\n\r\n\r\nhttp://www.apartystudio.etsy.com\r\nhttp://www.facebook.com/apartystudio\r\nhttp://pinterest.com/apartystudio/\r\nhttps://twitter.com/apartystudio \r\n\r\n",
"last_updated_tsz": 1412687350,
"listing_active_count": 926,
"login_name": "APartyStudio",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to A Party Studio! ",
"policy_payment": "I accept payment via Paypal and credit card. All payments must be made up front and the design work begins immediately following receipt of full payment. \r\nFlorida customers, please note a 6.5% sales tax will be applied when you check out. ",
"policy_shipping": "All products are digital files and will be sent via email with 1 to 3 business days once information for the design and payment have been received. Please ensure your Etsy email is updated and correct. If you have not received you proof in this time, please check you spam box and email me if still missing and include your order number. \r\n\r\nIf you need your order sooner than 1 to 3 business days, you can purchase the rush fee listing for $8 and I will prioritize your order so that you get your files within 24 hours. ",
"policy_refunds": "I try my very best to include pictures and very accurate and detailed descriptions of all the products in my shop. If you are unsatisfied with your order for any reason, please contact me within 3 business days and we can discuss a solution. Due to the customised nature of digital products, all sales are final. Once a proof is approved, no further changes will be made. I do make every effort to ensure my clients are happy.",
"policy_additional": "When placing your order, please submit your customisation information at the same time in the notes to seller section.\r\n\r\nDesigns are sold as printable designs/files. This gives my clients the freedom of how many and where they would like to print the design. When a design is purchased a high resolution print ready file (PDF or JPEG) will be created and sent to the customer for approval. If you have any changes once design is emailed to you, just let me know and I will be happy to update the file for you. If everything is how you would like it, then you are ready to print!\r\n\r\nAll PDF files cannot be altered or edited. PDF files need to be opened and printed from ADOBE READER. Adobe Reader comes on most computers. If you need to download a free copy go to the following link: http://get.adobe.com/reader/?promoid=JZEFU \r\n\r\nI recommend printing out all proofs to check colour. Different monitors and devices can show the colour incorrectly. Furthermore, colors my vary from monitor to monitor, as well as from printer to printer and I have no control over color variations.\r\n\r\nMinor text alternations will not incur a fee; however, if there is too much text or if it affects the existing template, then a fee will be applied. You shall be advised if this is going to be the case.\r\n\r\nYou will receive two free rounds of changes. If there are mistakes of my wrong doing, there will be no additional fee or included as part of the two rounds of changes. Please check your details carefully as A Party Studio is not responsible for any errors made by the client. Subsequent rounds of changes incur a $15 fee. \r\n\r\nIf you would like me to change the font of a printable, there is an additional $10 fee. If you would like me to change the color of a printable, there is an additional $5 fee.\r\n\r\nAll designs are for personal use and remain the copyright of A Party Studio and cannot be resold or redistributed. All files purchased from A Party Studio are for personal use only and the clients is not entitled to reproduction rights. Images and content are non-transferable. Sharing of files is strictly prohibited. Images/templates may not be resold in digital form, or as part of a digital kit. Printed goods from templates are not to be resold.\r\n\r\nAll photos submitted to A Party Studio need to be photos taken by yourself or you have permission from the photographer to use the photo(s). Please make sure there are no copyright infringement on the photos submitted. By submitting photos to A Party Studio, you agree that the photos being used were taken by you or the photographer has give you permission to use. You also agree to take full responsibility of any misuse of copyright images and agree to not hold A Party Studio liable for any misuse of copyrighted images.   \r\n\r\n",
"policy_seller_info": "Tali Burress\r\nPace, Florida\r\n\r\napartystudio@gmail.com ",
