"announcement": "This shop contains many items collected by our family over the years.  Many publications of Life and Look magazine from the 1960s, children&#39;s books, vintage bone china tea cups and saucers, vintage bone china plates, silverplate, sheet music from 1920-1940 and records from 1900-1920.  If you&#39;re looking for something specific and don&#39;t see it, please ask.  If I have it, I&#39;ll make it available on Etsy.\r\n\r\nI ship using the most economical method and try to reuse shipping materials where possible.  Other shipping options available if requested.\r\n\r\nI accept Paypal, Etsy gift cards and credit cards.",
